import React from 'react'
import TextField from "@material-ui/core/TextField"
import { ThemeProvider as MuiThemeProvider } from '@material-ui/core/styles';
import { AppBar } from '@material-ui/core';
import Button from "@material-ui/core/Button"
import { withStyles} from '@material-ui/core/styles';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Container from "@material-ui/core/Container";
import { makeStyles } from '@material-ui/core/styles';





export class EmailAndDob extends React.Component {
continue = e => {
  e.preventDefault()
  this.props.nextStep()
}
back = e => {
  e.preventDefault()
  this.props.previousStep()
}
  render () {
    const {values,handleChange} =this.props
    return (
     <MuiThemeProvider >
     <React.Fragment>
     <Container style={{textAlign:"center"}}>
     <div className={styles.root}>
      <AppBar position="static">
      <Toolbar>
        <IconButton className={styles.menuButton} color="inherit" aria-label="Menu">
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" color="inherit" className={styles.grow}>
          Email nad date of birth
        </Typography>
      </Toolbar>
    </AppBar>
    </div>
     <TextField
     label="E-email"
      onChange={handleChange("email")}
      defaultValue={values.email}
      margin="normal"
      variant="outlined"
      autoComplete="off"
      fullWidth
       required={true}
       style={{
          width: '50ch',
          align:'center'
         }}
      />
            <div style={{color: "red"}}>{values.errors.emailEr ? values.errors.emailEr:"" }</div>

      <br/>
           <TextField
        id="date"
        type="date"
       label="Date of Birth"
       className={useStyles.textField}
      onChange={handleChange("dob")}
      defaultValue="2002-05-24"
      margin="normal"
      variant="outlined"
      autoComplete="off"
      fullWidth
      required={true}
      style={{
          width: '50ch',
          align:'center'
         }}
      />
     <div style={{color: "red"}}>{values.errors.dobEr ? values.errors.dobEr:"" }</div>

      <br/>

      <br/>
      <Button 
      type="submit"
      variant="contained" 
       color="primary" 
      style= {{marginTop:"1rem"}}
      onClick={this.continue}
      style={{
          width: '20ch',
          align:'center'
         }}
      >
          Next
      </Button>
        <Button 
      type="submit"
      variant="contained" 
      color="secondary" 
      style= {{marginTop:"1rem"}}
      onClick={this.back}
      style={{
          width: '20ch',

         }}
      >
          Back
      </Button>
      </Container>
     </React.Fragment>
     </MuiThemeProvider>



    )
  }
}


 const styles = {
root: {
    flexGrow: 1,
},
grow: {
    flexGrow: 1,
},
menuButton: {
    marginLeft: -12,
    marginRight: 20,
},

    input: {
        color: 'white'

    }

};

const useStyles = {
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: spacing(1),
    marginRight: spacing(1),
    width: 200,
  },
};
export default  withStyles(styles)(EmailAndDob)
